"use strict";

function _classCallCheck(instance, Constructor) { if (!(instance instanceof Constructor)) { throw new TypeError("Cannot call a class as a function"); } }

// const nome = 'lailton';
// const obj = { nome };
// const novo = {...obj };
// console.log(novo);
// const idade = 12;
var Pessoa = function Pessoa(nome, sobre) {
  _classCallCheck(this, Pessoa);

  this.nome = nome;
  this.sobre = sobre;
};
